objet:
le but de la MJCSC de chiconi est de fédérer les associations et les acteurs éducatifs de la commune;
elle propose des actions d'animation de qualité à la population telles que:
promouvoir la culture traditionnelle et moderne: chant, danse, théâtre;
développer l'éducation populaire et proposer des loisirs;
développer les activités physique et sportives;
contribuer à lépanouissement de l'enfance et de jeunesse, en l'aident à affirmer personnalité et à préparer son autonomie dans une démarche de socialisation et de citoyenneté;

promouvoir et enseignement des valeurs de l'islam: l'altruisme, l'entraide, le vivre ensemble et le juste milieu;
- éducation populaire des valeurs civiques et morales;
- lutter contre toute forme de délinquance dans les quartiers proches;
- soutien scolaire et lutte contre l'illetrisme;
-  sensibilisation  et éducation à la protection de l'environnement;
- faciliter la mise en place d'un cadre propice à l'exercice des pratiques religieuses conformément aux enseignements de l'islam;
- protection de la jeunesse musulmane de la déviation et de l'ignorance au sujet de sa religion par la mise au point d'un programme éducatif et culturel adéquat

Initier, concevoir, organiser et ou développer de toutes les actions et de la promotion de la santé, santé, environnementale, et de la prévention à Mayotte, dans la région;
IREPS  se fait également le relais des actions menées au niveau national et international;
toutes actions de formation, d'accompagnement et soutien adaptés aux besoins des proportionnels du secteur social, médico-social, de l'éducation et de la santé;
des actions d'information, de formation, de capitalisation et de production de savoir;
des activités de création et de gestion des établissements et services sociaux, médico-sociaux;
des activités d'observatoire en promotion de la santé(développer la recherche, la recherche-action, contribuer à la définition, à la mise en oeuvre et à l'évaluation des politiques de santé publique du niveau local au niveau national

