Assister ses membres dans la poursuite de l'objectif d'intérêt général défini dans le préambule des présents statuts;
elle assure à cet effet, au bénéfice des entreprises de l'économie sociale et solidaire, sans préjudice des missions des organisations professionnelles, interprofessionnelles ou multi-professionnelles, et des réseaux locaux d'acteurs:
- la représentation auprès des pouvoirs publics des intérêts de l'économie sociale et solidaire;
- l'appui à la création, au développement et au maintien des entreprises;
- l'appui à la formation des dirigeants et des salariés des entreprises;
- la contribution à la collecte, à l'exploitation et à la mise à disposition des données économiques et sociales relatives aux entreprises de l'économie sociale et solidaire;
- l'information des entreprises sur la dimension européenne de l'économie sociale et solidaire et l'appui à l'établissement de liens avec les entreprises du secteur établies dans les autres états membres de l'union européenne;
- dans les collecivités régies par l'article 73 de la constitution, le développement et l'animation de la coopération internationale des collectivités concernées en matière d'économie sociale et solidaire;
elle assure la défense des intérêts de ses adhérents, et plus généralement à l'ensemble des acteurs de l'économie sociale et solidaire;
elle peut ester en justice aux fins, notamment, de faire respecter par les entreprises de son ressort et relevant du 2° du II de l'article 1er de la loi ess de 2014, l'application effective des conditions fixées à ce même article;
dans des conditions définies par le décret du 22 décembre 2015 de la loi ess de 2014, elle tient à jour et assure la publication de la liste des entreprises de l'économie sociale et solidaire, au sens des 1° et 2° du II de l'article 1er, qui sont situées dans son ressort;
elle peut, généralement, faire toutes opérations de quelque nature qu'elles soient, se rattachant directement ou interdirectement à cet objet, et susceptibles d'en faciliter le développement, la promotion, ou la réalisation dans le respect des principes de l'économie sociale et solidaire

