le Think Tank Uwonézi est un centre d'analyses et de réflexions de la société civile, qui s'impose une éthique fondée sur le respect des personnes, l'écoute, la tolérance dans les débats et plus globalement, la recherche de l'intérêt général ; Elle s'inscrit aussi selon les fondements de l'Économie Sociale et Solidaire ;  
Uwonézi a pour mission d'émettre avis et expertises pour favoriser des prises de décision en matière de politiques publiques ; Pour remplir ces missions, l'association s'engage à produire les réflexions de ses membres sur les grands enjeux de notre époque : 
	En participant aux grands débats nationaux, en faisant à Mayotte et ses probléma-tiques ; 
	En identifiant et en fédérant les talents qui peuvent contribuer à la réflexion et parti-ciper par leur action personnelle à l'évolution de la société ; 
	En réunissant ces acteurs autour de valeurs et d'une éthique affichée par l'association et qui font l'objet d'une charte annexée au règlement intérieur ; 
	En cherchant à favoriser le renouvellement intellectuel à travers une vision neutre politiquement ; 
	En analysant, élaborant et accompagnant la mise en uvre de solutions politiques opérationnelles auprès des leaders politiques, des élus nationaux et locaux, de l'ensemble des administrations et des structures ou entreprises privées et publiques et partenaires économiques qui participent aux politiques publiques ; 
	En contribuant à l'animation du débat démocratique, à la vie des idées, à la re-cherche et à l'amélioration des politiques publiques ; Elle fait connaître de nouveaux talents ; Elle popularise les idées politiques et les grands enjeux du monde contempo-rain auprès du monde politique, des médias, des entreprises, du grand public ; 
	En demeurant un lieu de concertation indépendant de tout parti politique en France et en Europe ; 
En pratique, Uwonézi peut mener une diversité d'actions, parmi lesquelles : publication de notes et d'essais, analyse de politiques publiques, organisation de conférences, de séminaires, actions de sensibilisation, développement de réseaux, formation (élus, colla-borateurs, syndicats, professionnels divers, jeunesse ;  ;  ; ) ;

