l'Association Accès à la Culture et Assistance aux Démunis a pour objet et vocation : 
-	favoriser l'acquisition et la diffusion de la connaissance sous toute ses formes, par la mise en place et l'animation - entre autres - d'ateliers, de structures de soutien scolaire, afin de garantir la transmission des connaissances auprès du plus grand nombre dans les domaines de l'éducation, des sciences et plus généralement de la culture ; 
-	d'apporter assistance et aide humanitaire et de réaliser des actions de solidarités et de bienfaisance auprès de populations vulnérables du fait d'une oppression politique, ethnique, économique ou sociale, de guerre, de catastrophe, de menace écologique ou de tout autre situation d'urgence ou de sous-développement, dans le but de répondre à leurs besoins vitaux ; 
-	toute activité complémentaire souhaité par les membres et validée par le Conseil d'Administration peut être créée dans le respect de l'objet social ;

